import React from "react";

import HomeButton from "./HomeButton";
import MenuButton from "./MenuButton";

import { NavbarStyle } from "../../2_styles/3_module/NavbarStyle";

export default function Navbar() {
  return (
    <div>
      <NavbarStyle>
        <div id="navbar">
          <HomeButton />
          <div>The Initiative</div>
          <MenuButton />
        </div>
      </NavbarStyle>
    </div>
  );
}
